export const meetingRoute={
	path:'/meeting',
	meta:{
		title:'会议管理'
	},
	children:[
		{
			path:'/meeting',
			name:"totalMeeting",
			meta:{
				title:'全部会议',
				nav:true,
				layout:'slider'
			},
			component:()=>import('./list')
		},
		{
			path:"/meeting/create",
			name:'createMeeting',
			meta:{
				title:'会议预定',
				nav:true,
				layout:'slider'
			},
			component:()=>import('./create')
		}
	]
}
